-- membuang struktur untuk function adiwraksa.fc_counterSO
DROP FUNCTION IF EXISTS `fc_counterSO`;
DELIMITER //
CREATE FUNCTION `fc_counterSO`(varNoSalesOrder VARCHAR(25),varItemId INT) RETURNS int(11)
BEGIN
	DECLARE qtyIssued INTEGER;
	
	SELECT SUM(qty_order) INTO qtyIssued FROM detail_job_order WHERE no_so=varNoSalesOrder AND item_id=varItemId;
	
	RETURN IFNULL(qtyIssued,0);
    END//
DELIMITER ;

-- membuang struktur untuk function adiwraksa.fc_countProgress
DROP FUNCTION IF EXISTS `fc_countProgress`;
DELIMITER //
CREATE FUNCTION `fc_countProgress`(itemId INTEGER,
  varDivisi VARCHAR (250)
) RETURNS int(11)
BEGIN
   DECLARE jmlProgress INT;
  SELECT 
    COUNT(*) INTO jmlProgress 
  FROM
    setting_process s 
    LEFT JOIN pekerjaan p 
      ON p.id = s.id_pekerjaan 
    LEFT JOIN divisi d 
      ON d.id = p.id_divisi 
  WHERE s.item_id=itemId AND d.id=varDivisi;
  
  RETURN jmlProgress;
  END//
DELIMITER ;

-- membuang struktur untuk function adiwraksa.fc_getQtyAwal
DROP FUNCTION IF EXISTS `fc_getQtyAwal`;
DELIMITER //
CREATE FUNCTION `fc_getQtyAwal`(varItem varchar (100),
  varNOSO varchar (100),
  varWO integer,
  varProcess integer
) RETURNS int(11)
BEGIN
  declare qtyAwal integer ;
  declare returnQtyAwal integer ;
  declare jmlData integer ;
  declare varUrutProgress integer ;
  
  select 
    s.no_urut into varUrutProgress 
  FROM
    setting_process s 
    LEFT JOIN item i 
      on i.id = s.item_id 
  where s.id_pekerjaan = varProcess 
    and i.itemno=varItem;
    
    
    select 
      Count(id) into jmlData 
    from
      progress 
    WHERE item_no = varItem 
      and id_wo = varWO 
      and no_so = varNOSO ;
  if (ifnull(jmlData, 0) > 0) 
  then
	  begin
		if varUrutProgress > 1 then
		  select 
		    SUM(ifnull(p.qty, 0)) into qtyAwal 
		  from
		    progress p 
		    left join setting_process s 
		      on p.id_pekerjaan = s.id_pekerjaan 
		      and p.item_id = s.item_id 
		  where p.item_no = varItem 
		    and p.id_wo = varWO 
		    and p.no_so = varNOSO 
		    and s.no_urut = varUrutProgress - 1 and p.stts='WIP';
		else 
		   SELECT qty into qtyAwal FROM wo_jobs WHERE id_wo=varWO and so_no=varNOSO and item_no=varItem;
		end if;
	  end;
  elseif (ifnull(jmlData,0) = 0) then
	if varUrutProgress = 1 then
	   SELECT qty INTO qtyAwal FROM wo_jobs WHERE id_wo=varWO AND so_no=varNOSO AND item_no=varItem;
	else
	   set qtyAwal = 0;
	end if;
  end if;
  
  return qtyAwal;
END//
DELIMITER ;

-- membuang struktur untuk function adiwraksa.fc_item_finish
DROP FUNCTION IF EXISTS `fc_item_finish`;
DELIMITER //
CREATE FUNCTION `fc_item_finish`(
  varItemId int,
  varNoSO varchar (100),
  varNoContainer varchar (100),
  varIdDivisi int
) RETURNS int(11)
BEGIN
  declare varQtyFinish int ;
  declare varMetodeHitung varchar (200) ;
  declare varRencanaId int ;
  select 
    rencana_id into varRencanaId 
  FROM
    detail_hasil_kerja 
  WHERE item_id = varItemId 
    and no_so = varNoSo 
    and no_container = varNoContainer 
    and id_divisi = varIdDivisi ;
  select 
    metode_perhitungan into varMetodeHitung 
  FROM
    rencana_kerja 
  WHERE id = varRencanaId ;
  if varMetodeHitung = 'PER SET' 
  then 
  begin
    select 
      sum(d.qty) into varQtyFinish 
    FROM
      detail_hasil_kerja d 
      LEFT JOIN hasil_kerja h 
        on h.nomer = d.nomer 
    where d.item_id = varItemId 
      and d.no_so = varNoSO 
      and d.no_container = varNoContainer 
      and h.id_divisi = varIdDivisi ;
  end ;
  else 
  begin
    select 
      sum(d.qty) / m.jumlah into varQtyFinish
    from
      detail_hasil_kerja d 
      left join 
        (select 
          i.id,
          m.itemno,
          m.jumlah,
          m.component_id 
        FROM
          material_product m 
          left join item i 
            on i.itemno = m.itemno 
        where i.id = varItemId) m 
        ON m.component_id = d.item_id 
    where d.parent_id = varItemId 
      AND d.no_so = varNoSO 
      AND d.no_container = varNoContainer 
      AND h.id_divisi = varIdDivisi ;
    end ;
    end if ;
    return varQtyFinish ;
  END//
DELIMITER ;

-- membuang struktur untuk function adiwraksa.fc_qtyFinishContainer
DROP FUNCTION IF EXISTS `fc_qtyFinishContainer`;
DELIMITER //
CREATE FUNCTION `fc_qtyFinishContainer`(varItem VARCHAR (100),
  varNOSO VARCHAR (100),
  varNoContainer varChar (100)
) RETURNS int(11)
BEGIN
  DECLARE qtyFinish INT ;
  SELECT 
    SUM(IFNULL(p.qty, 0)) INTO qtyFinish 
  FROM
    detail_hasil_kerja p 
    left join hasil_kerja h 
      ON h.nomer = p.nomer 
    LEFT JOIN item i 
      ON i.id = p.item_id 
  WHERE i.itemno = varItem 
    AND no_so = varNOSO 
    and p.no_container = varNoContainer ;
  RETURN qtyFinish ;
END//
DELIMITER ;

-- membuang struktur untuk function adiwraksa.fc_qtyFinishProcess
DROP FUNCTION IF EXISTS `fc_qtyFinishProcess`;
DELIMITER //
CREATE FUNCTION `fc_qtyFinishProcess`(varItem VARCHAR (100),
  varNOSO VARCHAR (100),
  varWO INTEGER,
  varProcess INTEGER
) RETURNS int(11)
BEGIN
  declare qtyFinish int ;
  select 
    sum(ifnull(p.qty,0)) into qtyFinish 
  from
    progress p 
  where item_no = varItem 
    and no_so = varNOSO 
    and id_wo = varWO 
    and id_pekerjaan = varProcess ;
    
    return qtyFinish;
END//
DELIMITER ;

-- membuang struktur untuk function adiwraksa.fc_qtyFinishSO
DROP FUNCTION IF EXISTS `fc_qtyFinishSO`;
DELIMITER //
CREATE FUNCTION `fc_qtyFinishSO`(varItem VARCHAR (100),
  varNOSO VARCHAR (100)
) RETURNS int(11)
