  RETURN qtyFinish ;
END//
DELIMITER ;

-- membuang struktur untuk function adiwraksa.fc_qtypacking
DROP FUNCTION IF EXISTS `fc_qtypacking`;
DELIMITER //
CREATE FUNCTION `fc_qtypacking`(Varno_container varchar (100),
  Varno_so varChar (100),
  Varitemno varchar (100)
) RETURNS int(11)
BEGIN
  declare qtyPacking integer ;
  select 
    sum(qty_packing) into qtyPacking 
  FROM
    shippment 
  where nomer_container = VarNo_container 
    and no_so = Varno_so 
    and item_id = Varitemno AND stts<>'Shipped' ;
   return qtyPacking;
END//
DELIMITER ;

-- membuang struktur untuk function adiwraksa.fc_qtyreadypacking
DROP FUNCTION IF EXISTS `fc_qtyreadypacking`;
DELIMITER //
CREATE FUNCTION `fc_qtyreadypacking`(`varItem` VARCHAR(100), `varNOSO` VARCHAR(100), `varNoContainer` VARCHAR(100)) RETURNS int(11)
BEGIN
  DECLARE varCounterProgress INT ;
  DECLARE qtyFinish INT ;
  declare varTotalProgress int;
  
  SELECT 
    COUNT(DISTINCT d.id) INTO varCounterProgress 
  FROM
    setting_process s 
    LEFT JOIN pekerjaan p 
      ON p.id = s.id_pekerjaan 
    LEFT JOIN divisi d 
      ON d.`id` = p.`id_divisi` 
    LEFT JOIN item i 
      ON i.`id` = s.`item_id` 
  WHERE i.id = varItem ;
  
  SELECT count(id_divisi) into varTotalProgress FROM progress
  where item_id=varItem and no_so=varNoSo and nomer_container=varNoContainer;
  
  if varTotalProgress = varCounterProgress then begin
  
		    SELECT 
		      ROUND(SUM(IFNULL(p.qty, 0))) INTO qtyFinish
		    FROM
		      progress p 
		      LEFT JOIN item i 
			ON i.id = p.item_id 
		    WHERE p.item_id = varItem 
		      AND p.no_so = varNOSO 
		      AND p.nomer_container = varNoContainer 
		    GROUP BY p.id_divisi,p.item_id,p.no_so,p.nomer_container 
		    ORDER BY ROUND(SUM(IFNULL(p.qty, 0))) ASC 
		    LIMIT 1 ;
		    RETURN qtyFinish ;
		  END ;
  ELSE RETURN 0 ;
  END IF ;
END//
DELIMITER ;

-- membuang struktur untuk function adiwraksa.fc_qtyShipped
DROP FUNCTION IF EXISTS `fc_qtyShipped`;
DELIMITER //
CREATE FUNCTION `fc_qtyShipped`(Varno_container VARCHAR (100),
  Varno_so VARCHAR (100),
  Varitemno VARCHAR (100)
) RETURNS int(11)
BEGIN
	DECLARE qtyShipped INTEGER ;
  SELECT 
    SUM(qty_packing) INTO qtyShipped 
  FROM
    shippment 
  WHERE nomer_container = VarNo_container 
    AND no_so = Varno_so 
    AND item_id = Varitemno and stts='Shipped';
   RETURN qtyShipped;
    END//
DELIMITER ;

-- membuang struktur untuk function adiwraksa.fc_total_menit
DROP FUNCTION IF EXISTS `fc_total_menit`;
DELIMITER //
CREATE FUNCTION `fc_total_menit`(varItemId int,
  varIdDivisi int,
  varDate Date
) RETURNS int(11)
BEGIN
  declare varTotalMenit Int ;
  SELECT 
    total_menit into varTotalMenit 
  FROM
    detailjadwal 
  WHERE item_id = varItemId 
    AND id_divisi = varIdDivisi 
    AND tgl = VarDate ;
    
    return varTotalMenit;
END//
DELIMITER ;

