-- membuang struktur untuk procedure adiwraksa.sp_progressSO
DROP PROCEDURE IF EXISTS `sp_progressSO`;
DELIMITER //
CREATE PROCEDURE `sp_progressSO`(
  in varNOSO varchar (100),
  in varNoContainer VARCHAR (100),
  in varItemId int
)
BEGIN
  declare finish int default 0 ;
  declare varPekerjaan varChar (200) ;
  declare varIdPekerjaan int ;
  declare str text ;
  declare varCountProgress int;
  declare curr cursor for 
  select Distinct 
    d.id,
    d.name 
  from
    setting_process s 
    left join pekerjaan p on p.id=s.id_pekerjaan 
    left join divisi d 
      on d.id = p.id_divisi 
  where s.item_id = varItemId GROUP BY d.id
  order by s.no_urut ASC ;
  declare continue handler for not found set finish = 1 ;
  
  
  set str =  'SELECT ';
  open curr ;
  LoopPekerjaan :
  loop
    fetch curr into varIdPekerjaan,varPekerjaan;
    
    if finish = 1 then leave LoopPekerjaan;
    end if;
    
    set str = CONCAT(str,' SUM(CASE WHEN d.id=',varIdPekerjaan,' then p.qty  else 0 END)  as "',varPekerjaan,'",');
  END LOOP ;
  CLOSE curr ;
  SET str = SUBSTR(str, 1, CHAR_LENGTH(str) - 1) ;
  
  SET str = CONCAT(
    str,
    ' FROM detail_hasil_kerja p LEFT JOIN hasil_kerja h ON 
    h.nomer=p.nomer LEFT JOIN divisi d ON d.id=h.id_divisi  '
  ) ;
  
  if varNOSO <> '' then
      set @str = CONCAT(str,' WHERE p.no_so="',varNoSO,'" AND p.item_id=',varItemId,' GROUP BY p.item_id');
  end if;
  
  if varNoContainer <> '' then
	SET @str = CONCAT(str,' WHERE p.no_container="',varNoContainer,'" AND p.item_id=',varItemId,' GROUP BY p.item_id');
  END IF;
  PREPARE stmt FROM @str ;
  EXECUTE stmt ;
  DEALLOCATE PREPARE stmt ;
    
    
  END//
DELIMITER ;

