-- membuang struktur untuk trigger adiwraksa.tg_delete_gc
DROP TRIGGER IF EXISTS `tg_delete_gc`;
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='';
DELIMITER //
CREATE TRIGGER `tg_delete_gc` AFTER DELETE ON `gantt_chart` 
    FOR EACH ROW BEGIN
	delete from jadwaldivisi where gc_code=old.code;
	DELETE FROM detailjadwal WHERE gc_code=old.code;
    END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

-- membuang struktur untuk trigger adiwraksa.tg_delete_shipment
DROP TRIGGER IF EXISTS `tg_delete_shipment`;
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='';
DELIMITER //
CREATE TRIGGER `tg_delete_shipment` AFTER DELETE ON `shippment` FOR EACH ROW BEGIN
	DECLARE varTotalShippment INT;
	DECLARE varTotalOrder INT;
	SELECT SUM(qty_packing) INTO varTotalShippment FROM shippment WHERE no_so=old.no_so AND nomer_container=old.nomer_container
	AND item_id=old.item_id;
	
	SELECT d.jumlah INTO varTotalOrder FROM detail_sales_order d LEFT JOIN sales_order s ON
	s.no_input=d.no_input WHERE s.no_sales_order=old.no_so AND s.nomer_container=old.nomer_container
	AND d.item_id=old.item_id;
	
	IF varTotalShippment < varTotalOrder THEN
	  UPDATE detail_sales_order d LEFT JOIN sales_order s ON s.no_input=d.no_input
	   SET shipped=false WHERE  s.no_sales_order=old.no_so AND s.nomer_container=old.nomer_container AND d.item_id=old.item_id;
	END IF;
    END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

-- membuang struktur untuk trigger adiwraksa.tg_shippment
DROP TRIGGER IF EXISTS `tg_shippment`;
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='';
DELIMITER //
CREATE TRIGGER `tg_shippment` AFTER INSERT ON `shippment` 
    FOR EACH ROW BEGIN
	declare varTotalShippment int;
	declare varTotalOrder int;
	select sum(qty_packing) into varTotalShippment FROM shippment WHERE no_so=new.no_so and nomer_container=new.nomer_container
	and item_id=new.item_id;
	
	select d.jumlah into varTotalOrder FROM detail_sales_order d left join sales_order s on
	s.no_input=d.no_input where s.no_sales_order=new.no_so and s.nomer_container=new.nomer_container
	and d.item_id=new.item_id;
	
	if varTotalShippment >= varTotalOrder then
	  update detail_sales_order d LEFT JOIN sales_order s ON s.no_input=d.no_input
	   set shipped=true where  s.no_sales_order=new.no_so and s.nomer_container=new.nomer_container and d.item_id=new.item_id;
	end if;
	
    END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

-- membuang struktur untuk trigger adiwraksa.tg_update_gc
DROP TRIGGER IF EXISTS `tg_update_gc`;
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='';
DELIMITER //
CREATE TRIGGER `tg_update_gc` AFTER UPDATE ON `gant_detail` FOR EACH ROW BEGIN
	declare varNoContainer varchar(100);
	declare varNoSO varchar(100);
	DECLARE varManHour INTEGER;
	DECLARE varBaseManHour INTEGER;
	
	
	SET varManHour = NEW.manhour;
	SET VarBaseManHour = varManHour / NEW.qty_order;

	
	SELECT so_no,nomer_container into varNoso,VarNoContainer FROM gantt_chart where gantt_chart.`code`=new.gantt_code;
	
	UPDATE detail_job_order d  LEFT JOIN master_job_order m ON m.no_input=d.no_input SET 
	d.tgl_mulai=new.tgl_mulai,
	d.tgl_akhir=new.tgl_akhir,
	alokasi_per_menit=varBaseManHour,
	total_alokasi=NEW.qty_order * alokasi_per_menit,
	total_alokasi_perhari=jml_karyawan * NEW.jam_kerja * 60,
	target_perolehan=ROUND((total_alokasi_perhari-total_alokasi) / alokasi_per_menit) + qty_order
	WHERE d.item_id=new.item_id AND d.nomer_container=varNoContainer AND d.no_so=varNoSO AND m.id_divisi=new.id_divisi;
    END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

